import { Layout, Menu, theme } from 'antd';
const { Header} = Layout;
const YoHeader = () => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
      <Header>
        <div className="logo"></div> 
        <Menu
          theme="dark"
          mode="horizontal"
          defaultSelectedKeys={['2']}
          items={new Array(15).fill(null).map((_, index) => {
            const key = index + 1;
            return {
              key,
              label: `nav ${key}`,
            };
          })}
        />
      </Header>
  );
};
export default Header;
